package pojos;

public class BulkUser {
	private BulkUserField name;
	private BulkUserField email;
	private BulkUserField mobile;
	public BulkUser() {
		super();
		// TODO Auto-generated constructor stub
	}
	public BulkUserField getName() {
		return name;
	}
	public void setName(BulkUserField name) {
		this.name = name;
	}
	public BulkUserField getEmail() {
		return email;
	}
	public void setEmail(BulkUserField email) {
		this.email = email;
	}
	public BulkUserField getMobile() {
		return mobile;
	}
	public void setMobile(BulkUserField mobile) {
		this.mobile = mobile;
	}
	
}
